import React, { useEffect, useRef, useState } from 'react';
import { Link } from 'react-router-dom';
import '../styles/Home.css';

const subtitles = [
  'Cybersecurity Enthusiast',
  'Full Stack Developer',
  'Open Source Contributor',
  'Problem Solver'
];

function Home() {
  const [subtitleIndex, setSubtitleIndex] = useState(0);
  const [displayed, setDisplayed] = useState('');
  const [typing, setTyping] = useState(true);

  useEffect(() => {
    let timeout;
    if (typing) {
      if (displayed.length < subtitles[subtitleIndex].length) {
        timeout = setTimeout(() => {
          setDisplayed(subtitles[subtitleIndex].slice(0, displayed.length + 1));
        }, 60);
      } else {
        setTyping(false);
        timeout = setTimeout(() => setTyping(true), 1000);
      }
    } else {
      if (displayed.length > 0) {
        timeout = setTimeout(() => {
          setDisplayed(subtitles[subtitleIndex].slice(0, displayed.length - 1));
        }, 30);
      } else {
        setTyping(true);
        setSubtitleIndex((prev) => (prev + 1) % subtitles.length);
      }
    }
    return () => clearTimeout(timeout);
  }, [displayed, typing, subtitleIndex]);

  return (
    <section className="hero-section">
      <video className="hero-bg-video" autoPlay loop muted playsInline>
        <source src="/Screencast_20250509_231337.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>

      <div className="hero-content">
        <div className="hero-text">
          <div className="hero-greeting">Hello, it&apos;s me</div>
          <div className="hero-name">Amitathoriya</div>
          <div className="hero-animated">
            And I&apos;m a <span className="animated-subtitle">{displayed}&nbsp;</span>
            <span className="cursor">|</span>
          </div>

          <ul className="info-list">
            <li>üëã Hi, I'm @Amitathoriya</li>
            <li>üëÄ I'm passionate about cybersecurity and full stack development. I love exploring the intersection of secure systems and scalable web solutions.</li>
            <li>üîê Currently working on a Java-based Password Manager merging security with usability.</li>
            <li>üå± Learning C++, Java, cloud computing, and bug bounty methodologies.</li>
            <li>üíûÔ∏è Open to collaborating on cybersecurity-focused open source projects.</li>
            <li>üí° Excited to build, learn, and share with the developer community.</li>
          </ul>
        </div>

        <div className="hero-image-container">
          <img src="/Git_profiel.jpg" alt="Profile" className="hero-image" />
        </div>
      </div>

      <div className="card-row">
        <Link to="/projects" className="card-link">
          <div className="card">
            <img src="/Git_profiel.jpg" alt="Projects" className="card-img" />
            <div className="card-label">Projects</div>
          </div>
        </Link>
        <Link to="/achievements" className="card-link">
          <div className="card">
            <img src="/Git_profiel.jpg" alt="Achievements" className="card-img" />
            <div className="card-label">Achievements</div>
          </div>
        </Link>
        <Link to="/about" className="card-link">
          <div className="card">
            <img src="/Git_profiel.jpg" alt="About" className="card-img" />
            <div className="card-label">About</div>
          </div>
        </Link>
      </div>
    </section>
  );
}

export default Home;
